import React from "react";
import { Chart } from "react-charts";
import ResizableBox from "../ResizableBox";

function Momentum(props) {
    // const data = props.data?.content?.momentum?.main?.data
    // console.log(data)

    type DailyStars = {
        date: Date,
        stars: number,
      }

      type Series = {
        label: string,
        data: DailyStars[]
      }

      const data: Series[] = [
        {
          label: 'React Charts',
          data: [
            {
              date: new Date(),
              stars: 202123,
            }
            // ...
          ]
        },
        {
          label: 'React Query',
          data: [
            {
              date: new Date(),
              stars: 10234230,
            }
            // ...
          ]
        }
      ]

    const primaryAxis = React.useMemo(
        (): AxisOptions<DailyStars> => ({
          getValue: datum => datum.date,
        }),
        []
    )

      const secondaryAxes = React.useMemo(
        (): AxisOptions<DailyStars>[] => [
          {
            getValue: datum => datum.stars,
          },
        ],
        []
    )

    return (
        <div className="w-full rounded-lg py-4 bg-white brd gap-4">
            <div className="text-center font-medium text-base px-4">Match Momentum</div>
            <div className="brd05"></div>
            <Chart
                options={{
                    data,
                    primaryAxis,
                    secondaryAxes,
                }}
                />       
            </div>
    )
}

export default Momentum
